// import './Board.css';

function Board() {

    const alphabet = Array.from({ length: 25 }, (_, i) => {
            if(i != 9) {
                return String.fromCharCode(97 + i)
            }
        }
    );



    return (
        alphabet.map((letter, index) => (
            <p key={index}>{letter}</p>
        ))
    );
}

export default Board;
